            "es-MX": "El resultado será el primer valor que se proporcionó al parámetro del valor de entrada para la acción o condición determinada (es útil para no reevaluar de forma selectiva ciertas partes de un valor cuando se usan en conjunto con una acción capaz de reevaluar).",
